import { BrowserRouter as Router, Route } from 'react-router-dom'

import Home from './pages/Home'
import ProductPage from './pages/ProductPage';

function App() {

  return (
    <Router>
      <Route path='/' exact><Home/></Route>
      <Route path='/products/:handle'><ProductPage/></Route>
    </Router>
  );
}

export default App;
